import React from "react";
import { useLocation, useNavigate } from "react-router-dom";
import { baseUrl } from "../Components/Shared";

function Logout() {
	const navigate = useNavigate();
	const location = useLocation();

	return (
		<button
			className="bg-gray-500 px-3 py-1 hover:bg-gray-600 text-white rounded-sm"
			onClick={(e) => {
				const url = baseUrl + "api/customers/";
				fetch(url, {
					headers: {
						"Content-Type": "application/json",
						Authorization: "Bearer " + localStorage.clear("access"), //Bearar gap is importent
					},
				})
					.then((response) => {
						// if (response.status === 401) {
						// 	navigate('/login')
						// }
						navigate(
							location?.state?.previousUrl
								? location.state.previousUrl
								: "/login"
						);
						if (!response.ok) {
							throw new Error("Page Logout..");
						}
					})
					.then((data) => {
						console.log(data);
					})
					.catch((e) => {
						console.log(e);
					});
			}}
		>
			Logout
		</button>
	);
}

export default Logout;
